######################################################################
# 0. Prerequisites
# ----------------
# 


######################################################################
# This notebook explains the basics of using Pytorch Geometric library for
# atomistic machine learning. It is assumed that you are familiar with the
# basics of PyTorch. If not, please check out the `official PyTorch
# tutorials <https://pytorch.org/tutorials/>`__.
# 
# For the following work we need to first install the PyTorch and PyTorch
# Geometric libraries. YThere are several options how to do it, the
# easiest one is to do it via PyPI:
# 
# .. code:: bash
# 
#    pip install torch
