# installation
# guide <https://pytorch-geometric.readthedocs.io/en/latest/notes/installation.html>`__.
# 


######################################################################
# 1. Meet PyTorch Geometric Data objects for Graph objects
# --------------------------------------------------------
# 


######################################################################
# The main object in PyTorch Geometric is the ``Data`` object. It is used
# to represent a single graph object. The ``Data`` object contains several
# attributes: ``x`` for node features, ``edge_index`` for edge indices,
# ``edge_attr`` for edge features, ``y`` for node targets, and ``pos`` for
# node positions. All attributes are stored in the form of PyTorch
# tensors.
# 

import torch
from torch_geometric.data import Data


######################################################################
# Let’s first define the basic graph object. It will have 3 nodes with
# indices 0, 1 and 2. The graph will have 2 edges: 0 -> 1 and 1 -> 2. Each
# node will have only one feature: -1 for node 0, 0 for node 1 and 1 for
# node 2.
# 

edge_index = torch.tensor([[0, 1, 1, 2],
                           [1, 0, 2, 1]], dtype=torch.long) # Adjacency matrix
x = torch.tensor([[-1], [0], [1]], dtype=torch.float) # Node features
 
data = Data(x=x, edge_index=edge_index) # Base class for graph representation

data


######################################################################
# .. figure:: https://pytorch-geometric.readthedocs.io/en/latest/_images/graph.svg
#    :alt: Graph
# 
#    Graph
# 


######################################################################
# Node features, edge indices and edge features of the graph may be
# accessed as attributes of the ``Data`` object.
# 

print(data.x) # Node features

print(data.edge_index) # Edge indices

print(data.edge_attr) # Edge features, though we don't have any so far


######################################################################
# Our ``Data`` object also contain the information about the number of
# node features, number of edge features and graph topopogy
# 

print(f'Number of node features: {data.num_node_features}')
print(f'Number of edge features: {data.num_edge_features}')

print(f'Contains isolated nodes: {data.has_isolated_nodes()}')
print(f'Contains self-loops: {data.has_self_loops()}')


######################################################################
# 2. Wrapping the data objects into a Dataset
# -------------------------------------------
# 


######################################################################
# As the original Pytorch, the Pytorch Geometric library has a special
# class for hadling a set of ``Data`` objects. It is called ``Dataset``
# and is defined in the ``torch_geometric.data`` module. There is also a
# bunch of predefined datasets in the ``torch_geometric.datasets`` module.
# 
# Let’s take a loot into one of them - the ENZYMES dataset. It contains
# 600 graphs of enzymes with 3-200 nodes obtained from the BRENDA enzyme
# database. The ENZYMES dataset contains 6 classes of enzymes. To load the
# dataset, we first need to import the ``TUDataset`` class from the
# ``torch_geometric.datasets`` module, and then specify the name of the
# dataset (ENZYMES) and the root directory where the dataset will be
# stored. The dataset will be automatically downloaded and extracted to
# the specified directory.
# 
# Source: `When Work Matters: Transforming Classical Network Structures to
# Graph CNN <https://arxiv.org/abs/1807.02653>`__
# 

from torch_geometric.datasets import TUDataset

dataset = TUDataset(root='/tmp/ENZYMES', name='ENZYMES', use_node_attr=True)

dataset # Contains 600 graphs


######################################################################
# Elements of the dataset are Data objects. The first data object in the
# dataset has 37 nodes, 168 edges, and 21 features for each node. The
# graph is also labeled with the class 5, that is stored in the ``y``
# attribute of the data object.
# 


######################################################################
# The dataset also has metadata stored in form of attributes of the
# dataset object. The ``num_classes`` attribute contains the number of
# classes in the dataset, and the ``num_node_features`` attribute contains
# the number of node features in the dataset, and the
# ``num_edge_features`` attribute contains the number of edge features in
# the dataset.
# 
# These options will not necessarily be presented in all datasets. For
# example, the ``Cora`` dataset does not have edge features, and the
# ``QM9`` dataset does not have node labels.
# 

print(f"Total number of entries: {len(dataset)}")
print(f'Number of node features: {dataset.num_node_features}')
print(f'Number of edge features: {dataset.num_edge_features}')
print(f'Number of classes: {dataset.num_classes}')


######################################################################
# For conveniece, the dataset may be shuffled by calling the ``shuffle()``
# method of the dataset object. Please note, that it works out-of-place.
# 

dataset = dataset.shuffle()


######################################################################
# 3. Mini-batches
# ---------------
# 


######################################################################
# One of the main issued with the graph data is that the graphs may have
# different number of nodes and edges. This feature requires to use a
# specific way of joining the graphs into mini-batches. The PyTorch
# Geometric library provides a special class for this purpose -
# ``torch_geometric.loader.DataLoader``. It works in the same way as the
# original PyTorch ``DataLoader`` class, but it joins the graphs in a way
# that allows to use them in the graph neural networks.
# 


######################################################################
# The way it works is that it joins all graphs in the mini-batch into a
# single large graph. The connectivity information for this new graph is
# stored in a new block diagonal adjacency matrix. The node and edge
# features are stored in a single large node feature tensor and edge
# feature tensor, respectively.
# 
# I.e., if we had a graph :math:`G_1 = (X_1, A_1)` and graph
# :math:`G_2 = (X_2, A_2)`, then uniting them into a Batch will result in
# a new graph :math:`G_{batch} = (X_{batch}, A_{batch})`, where
# :math:`A_{batch} = \begin{bmatrix} A_1 & 0 \\ 0 & A_2 \end{bmatrix}` and
# :math:`X_{batch} = \begin{bmatrix} X_1 \\ X_2 \end{bmatrix}`. The Batch
# object also contains the information about the number of nodes in each
# graph in the batch in the ``batch`` attribute.
# 


######################################################################
# .. figure:: data:image/png;base64,
#    :alt: Screen Shot 2020-08-27 at 13.11.53.png
# 
#    Screen Shot 2020-08-27 at 13.11.53.png
# 


######################################################################
# Let’s create a DataLoader and see how it works.
# 

from torch_geometric.loader import DataLoader

loader = DataLoader(dataset, batch_size=8, shuffle=True) # Batch size of 8

batch = next(iter(loader)) # Get first batch of 8 graphs


######################################################################
# Please note, that the ``Batch`` object looks very similar to ``Data``
# object. It has the same attibutes, but also includes the ``batch``
# attribute, that tells which node belongs to which original graph
# 

batch

batch.batch # Each of 300 nodes has a label, which graph it belongs to